import React from "react";
import "./Profile.css"; // Ensure this file exists, or remove if not needed

const Profile = () => {
  return (
    <div className="profile">
      <h3>User Profile</h3>
      <p>Name: John Doe</p>
      <p>Email: john.doe@example.com</p>
      <button>Edit Profile</button>
    </div>
  );
};

export default Profile;
